import { useContext } from "react";
import { MyContext } from "../App";
import BookItem from "./BookItem";

const BookList = () => {

    const context = useContext(MyContext);

    context.map(book =>{
        return (
            <ul>
                <BookItem books={context}/>
            </ul>
        );
    });
}

export default BookList;
